import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <h1>E-Shop</h1>
      <input type="text" placeholder="Search for products" />
      <nav>
        <a href="/cart">Cart</a>
        <a href="/login">Login</a>
      </nav>
    </header>
  );
};

export default Header;
